import Button from "@/components/Button";
import AllocatedRequesCallback from "@/components/callBackscreen/AllocatedRequesCallback";
import ProjectFilter from "@/components/filter/ProjectFilter";
import SearchHeader from "@/components/searchandfilter/SearchHeader";
import { closeModal } from "@/redux/slices/modalSlice";
import Icon from "react-native-vector-icons/AntDesign";
import { FirmUnitData } from "@/utils/constant";

import { colors, fonts } from "@/theme";
import React, { useState } from "react";
import {
  View,
  Text,
  StyleSheet,
  FlatList,
  TouchableOpacity,
  Image,
  Modal,
  ScrollView,
} from "react-native";
import { useDispatch, useSelector } from "react-redux";
import FirmFilter from "@/components/filter/FirmFilter";
import FirmUnitCard from "@/components/tabs/FirmUnitCard";

const FirmUnitsDetail = () => {
  const [modalVisible, setModalVisible] = useState(false);

  const dispatch = useDispatch();
  const isModalOpen = useSelector((state: any) => state.modal.isOpen); // Access modal state

  const handleCloseModal = () => {
    dispatch(closeModal()); // Dispatch action to close the modal
  };

  return (
    <View style={styles.container}>
      <SearchHeader onFilterPress={() => setModalVisible(true)} />

      <View style={{ paddingHorizontal: 16 }}>
        <Text style={styles.header}>2 Firm Units</Text>
      </View>
      <ScrollView>
        <FlatList
          data={FirmUnitData}
          keyExtractor={(item) => item.id}
          renderItem={({ item }) => <FirmUnitCard unit={item} />}
        />
      </ScrollView>
      <View style={{ padding: 16 }}>
        <Button label="Submit Worksheet" icon="plus" />
      </View>
      <Modal
        animationType="slide"
        transparent={true}
        visible={modalVisible}
        onRequestClose={() => setModalVisible(false)}
      >
        <View style={styles.modalOverlay}>
          <FirmFilter setModalVisible={(value) => setModalVisible(value)} />
        </View>
      </Modal>

      <Modal
        visible={isModalOpen}
        transparent={true}
        animationType="slide"
        onRequestClose={handleCloseModal}
      >
        <View style={styles.modalOverlay}>
          <AllocatedRequesCallback />
        </View>
      </Modal>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: colors.formBackground,
  },
  header: {
    fontSize: 18,
    fontWeight: "600",
    color: "#1f2937",
    marginBottom: 12,
  },
  card: {
    backgroundColor: colors.white,
    padding: 16,
    // marginBottom: 12,
    borderRadius: 8,
    shadowColor: "#000",
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.1,
    borderBottomWidth: 1,
    borderBottomColor: colors.disablebutton,
    shadowRadius: 4,
    elevation: 3,
  },
  names: {
    fontSize: 16,
    fontWeight: "700",
    lineHeight: 24,
    color: colors.primaryBlue,
    fontFamily: fonts.calibri.bold,
    marginBottom: 8,
  },
  row: {
    flexDirection: "row",
    alignItems: "center",
    gap: 6,
    marginBottom: 8,
  },
  price: {
    fontSize: 14,
    fontWeight: "700",
    lineHeight: 20,
    color: colors.gray,
    fontFamily: fonts.calibri.bold,
  },
  suite: {
    fontSize: 14,
    fontWeight: "400",
    lineHeight: 20,
    color: colors.gray,
    fontFamily: fonts.calibri.regular,
    marginLeft: 4,
  },
  details: {
    fontSize: 14,
    fontWeight: "400",
    lineHeight: 20,
    color: colors.gray,
    fontFamily: fonts.calibri.regular,
    marginBottom: 8,
  },
  code: {
    fontSize: 14,
    fontWeight: "400",
    color: colors.primary,
    fontFamily: fonts.calibri.regular,
    lineHeight: 20,
    textDecorationLine: "underline",
    marginBottom: 8,
  },
  icon: {
    width: 16,
    height: 16,
    marginRight: 8,
  },
  conditionText: {
    fontSize: 14,
    fontWeight: "400",
    color: colors.primaryBlue,
    fontFamily: fonts.calibri.regular,
    lineHeight: 20,
    marginRight: 5,
  },
  modalOverlay: {
    marginTop: 40,
    flex: 1,
    justifyContent: "flex-end",
    backgroundColor: "rgba(0, 0, 0, 0.5)",
  },
});

export default FirmUnitsDetail;
